B.HQ=new A.jY("TCS City School Web App is a dynamic platform created exclusively for City School alumni. Upon registration, users can view, like, comment on, and share posts from other alumni. They can also create posts with photos and videos, connect and chat with fellow alumni, and explore their profiles. The app features job postings by alumni where users can apply for or post job opportunities. Additionally, users can view and organize school events, watch YouTube videos related to City School, keeping them engaged with their alma mater.","TCS City School Alumni Network","Skills : Flutter , Bloc ,Php Laravel , Firebase , ScreenUtil"," https://www.youtube.com/watch?v=5CMSXVOIof4&feature=youtu.be",!1,null)
B.HR=new A.jY("Kpharma is a comprehensive app for healthcare management and pharmacy operations. Patients can book doctor appointments, order medicines, view test results, and access medical reports. Doctors can manage their appointments and pharmacy tasks. The Admin Panel includes a dedicated section for pharmacies to add medicine products, upload patient reports, and view patient history. With a user-friendly interface and robust features, Kpharma simplifies healthcare access and management for patients, doctors, and pharmacies alike.","Kpharma: All-in-One Pharmacy & Healthcare Management",u.i,"https://youtu.be/v4Wwx0QFzQU",!1,null)
B.HS=new A.jY("Our attendance management app, built with Flutter for a seamless user experience, offers a comprehensive solution for tracking and managing employee attendance. Admins can easily register employees, who can then utilize the app to:\n\n- View their attendance history\n- Check in and check out daily\n- Monitor late arrivals and upcoming leave\n- Receive company notifications\n- Access and update their profile, including changing their profile picture\n- Mark attendance using facial recognition or a PIN\n- Apply for new leave requests\n\nThe frontend of the app was developed by me, while the backend, powered by PHP Laravel, was expertly handled by backend developers.\n","Attendance Management App","Skills : Flutter , Bloc ,Php Laravel , Tflite  , ScreenUtil","https://www.youtube.com/watch?v=0NEKUpkBcos",!1,null)
B.HT=new A.jY("QuizMaster is an engaging quiz app built with Flutter and Firebase. As my first app while I was still a beginner, it allowed me to explore the basics of app development and Firebase integration. \n\nFeatures of QuizMaster include:\n- Secure sign-up and login using Firebase Authentication\n- Interactive quizzes with various questions\n- Real-time tracking of quiz results\n\nWith a user-friendly interface and real-time data handling, QuizMaster offers a seamless experience for both learning and assessment.\n","Quiz App with Firebase",u.i,"https://youtu.be/liIJlfjquj8",!1,null)
B.HU=new A.jY("Big Cart is your one-stop shop for all your food delivery needs. From fast food and fresh fruits to vegetables and cooking utensils, we\u2019ve got it all. Explore a wide range of dairy products, oils, and more, all delivered straight to your door. With an intuitive app design and diverse categories, Big Cart makes grocery shopping effortless. Enjoy quick, reliable service and a vast selection tailored to your needs. Discover convenience and quality with every order on Big Cart! Stay tuned for a complete demo and admin panel details, which will be shared soon.","Big Cart ( Food Delivery App )","Skills : Flutter , Bloc , Firebase , Stripe , ScreenUtil","https://youtu.be/RuIPz1ftfTI",!0,null)
B.HV=new A.jY("EasyAgro is a comprehensive multivendor app designed to streamline agricultural operations. Farmers can register to access crucial weather updates, forecasts, and use a fertilizer calculator to determine the optimal amount of fertilizer for their crops. Companies and dealers can also register, with companies adding products related to spray farming utensils, and dealers purchasing these items directly. The app features a chat function, allowing companies and dealers to communicate and share images seamlessly. Admins ensure a secure platform by verifying company and dealer accounts through CNIC and license reviews. EasyAgro connects all facets of agriculture in one efficient platform.","EasyAgro ( A multi-user app for farmers,dealers ,companies)",u.i,"https://www.youtube.com/watch?v=c31mhDxxxTY",!1,null)
